/* harmony default export */ __webpack_exports__["default"] = ("<ion-header>\r\n  <ion-toolbar>\r\n    <ion-title>Privacy</ion-title>\r\n  </ion-toolbar>\r\n</ion-header>\r\n<ion-content>\r\n  <h2>\r\n    Polityka prywatności opisuje zasady przetwarzania przez nas informacji na Twój temat, w tym danych osobowych oraz ciasteczek, czyli tzw. cookies.\r\n  </h2>\r\n\r\n  <h3>1 Informacje ogólne</h3>\r\n  <ol>\r\n    <li>\r\n      Niniejsza polityka dotyczy Serwisu www, funkcjonującego pod adresem url: <b>habit-tracker.com</b>\r\n    </li>\r\n    <li>Operatorem serwisu oraz Administratorem danych osobowych jest: Studenci</li>\r\n    <li>Adres kontaktowy poczty elektronicznej operatora: support@habittracker.com</li>\r\n    <li>Operator jest Administratorem Twoich danych osobowych w odniesieniu do danych podanych dobrowolnie w Serwisie</li>\r\n    <li>\r\n      Serwis wykorzystuje dane osobowe w następujących celach:\r\n      <ul>\r\n        <li>Prowadzenie newslettera</li>\r\n        <li>Obsługa zapytań przez formularz</li>\r\n        <li>Obsługa zamówień towarów - przygotowanie, pakowanie, wysyłka</li>\r\n        <li>Realizacja zamówionych usług</li>\r\n        <li>Obsługa odpowiednich dokumentów księgowych</li>\r\n        <li>Windykacja należności</li>\r\n        <li>Prezentacja oferty lub informacji</li>\r\n        <li>\r\n          Wykonanie przez Administratora danych osobowych prawnie ciążących na nim obowiązków zgodnie z art. 6 ust. 1 lit. c) RODO w zakresie w jakim przewidują to przepisy szczególne (np. prowadzenie księgowości).\r\n        </li>\r\n        <li>\r\n          Serwis realizuje funkcje pozyskiwania informacji o użytkownikach i ich zachowaniu w następujący sposób:\r\n          <ol>\r\n            <li>\r\n              Poprzez dobrowolnie wprowadzone w formularzach dane, które zostają wprowadzone do systemów Operatora.\r\n            </li>\r\n            <li>\r\n              Poprzez zapisywanie w urządzeniach końcowych plików cookie (tzw. „ciasteczka”).\r\n            </li>\r\n          </ol>\r\n        </li>\r\n      </ul>\r\n    </li>\r\n  </ol>\r\n\r\n  <h3>2. Wybrane metody ochrony danych stosowane przez Operatora</h3>\r\n  <ol>\r\n    <li>\r\n      Dane osobowe przechowywane w bazie danych są zaszyfrowane w taki sposób, że jedynie posiadający Operator klucz może je odczytać. Dzięki temu dane są chronione na wypadek wykradzenia bazy danych z serwera.\r\n    </li>\r\n    <li>\r\n      Hasła użytkowników są przechowywane w postaci hashowanej. Funkcja hashująca działa jednokierunkowo - nie jest możliwe odwrócenie jej działania, co stanowi obecnie współczesny standard w zakresie przechowywania haseł użytkowników.\r\n    </li>\r\n    <li>\r\n      Operator okresowo zmienia swoje hasła administracyjne.\r\n    </li>\r\n    <li>\r\n      Istotnym elementem ochrony danych jest regularna aktualizacja wszelkiego oprogramowania, wykorzystywanego przez Operatora do przetwarzania danych osobowych, co w szczególności oznacza regularne aktualizacje komponentów programistycznych.\r\n    </li>\r\n  </ol>\r\n\r\n  <h3>3. Hosting</h3>\r\n  <ol>\r\n    <li>Serwis jest hostowany (technicznie utrzymywany) na serwera operatora: home.pl</li>\r\n  </ol>\r\n\r\n  <h3>4. Twoje prawa i dodatkowe informacje o sposobie wykorzystania danych</h3>\r\n  <ol>\r\n    <li>\r\n      W niektórych sytuacjach Administrator ma prawo przekazywać Twoje dane osobowe innym odbiorcom, jeśli będzie to niezbędne do wykonania zawartej z Tobą umowy lub do zrealizowania obowiązków ciążących na Administratorze. Dotyczy to takich grup odbiorców:\r\n      <ul>\r\n        <li>\r\n          osoby upoważnione przez nas, pracownicy i współprcownicy, którzy muszą mieć dostęp do danych osobowych w celu wykonywania swoich obowiązków\r\n        </li>\r\n        <li>firma hostingowa</li>\r\n        <li>firmy obsługująca mailingi</li>\r\n        <li>firmy obsługująca komunikaty SMS</li>\r\n        <li>firmy z którymi Administrator współpracuje w zakresie marketingu własnego</li>\r\n        <li>kurierzy</li>\r\n        <li>ubezpieczyciele</li>\r\n        <li>kancelarie prawne i windykatorzy</li>\r\n        <li>banki</li>\r\n        <li>operatorzy płatności</li>\r\n        <li>organy publiczne</li>\r\n      </ul>\r\n    </li>\r\n    <li>\r\n      Twoje dane osobowe przetwarzane przez Administratora nie dłużej, niż jest to konieczne do wykonania związanych z nimi czynności określonych osobnymi przepisami (np. o prowadzeniu rachunkowości). W odniesieniu do danych marketingowych dane nie będą przetwarzane dłużej niż przez 3 lata.\r\n    </li>\r\n    <li>\r\n      Przysługuje Ci prawo żądania od Administratora:\r\n      <ul>\r\n        <li>dostępu do danych osobowych Ciebie dotyczących,</li>\r\n        <li>ich sprostowania,</li>\r\n        <li>usunięcia,</li>\r\n        <li>ograniczenia przetwarzania,</li>\r\n        <li>oraz przenoszenia danych.</li>\r\n      </ul>\r\n    </li>\r\n    <li>\r\n      Przysługuje Ci prawo do złożenia sprzeciwu w zakresie przetwarzania wskazanego w pkt 3.3 c) wobec przetwarzania danych osobowych w celu wykonania prawnie uzasadnionych interesów realizowanych przez Administratora, w tym profilowania, przy czym prawo sprzeciwu nie będzie mogło być wykonane w przypadku istnienia ważnych prawnie uzasadnionych podstaw do przetwarzania, nadrzędnych wobec Ciebie interesów, praw i wolności, w szczególności ustalenia, dochodzenia lub obrony roszczeń.\r\n    </li>\r\n    <li>\r\n      Na działania Administratora przysługuje skarga do Prezesa Urzędu Ochrony Danych Osobowych, ul. Stawki 2, 00-193 Warszawa.\r\n    </li>\r\n    <li>\r\n      Podanie danych osobowych jest dobrowolne, lecz niezbędne do obsługi Serwisu.\r\n    </li>\r\n    <li>\r\n      W stosunku do Ciebie mogą być podejmowane czynności polegające na zautomatyzowanym podejmowaniu decyzji, w tym profilowaniu w celu świadczenia usług w ramach zawartej umowy oraz w celu prowadzenia przez Administratora marketingu bezpośredniego.\r\n    </li>\r\n    <li>\r\n      Dane osobowe nie są przekazywane od krajów trzecich w rozumieniu przepisów o ochronie danych osobowych. Oznacza to, że nie przesyłamy ich poza teren Unii Europejskiej.\r\n    </li>\r\n  </ol>\r\n\r\n  <h3>5. Informacje w formularzach</h3>\r\n  <ol>\r\n    <li>\r\n      Serwis zbiera informacje podane dobrowolnie przez użytkownika, w tym dane osobowe, o ile zostaną one podane.\r\n    </li>\r\n    <li>\r\n      Serwis może zapisać informacje o parametrach połączenia (oznaczenie czasu, adres IP).\r\n    </li>\r\n    <li>\r\n      Serwis, w niektórych wypadkach, może zapisać informację ułatwiającą powiązanie danych w formularzu z adresem e-mail użytkownika wypełniającego formularz. W takim wypadku adres e-mail użytkownika pojawia się wewnątrz adresu url strony zawierającej formularz.\r\n    </li>\r\n    <li>\r\n      Dane podane w formularzu są przetwarzane w celu wynikającym z funkcji konkretnego formularza, np. w celu dokonania procesu obsługi zgłoszenia serwisowego lub kontaktu handlowego, rejestracji usług itp. Każdorazowo kontekst i opis formularza w czytelny sposób informuje, do czego on służy.\r\n    </li>\r\n  </ol>\r\n\r\n  <h3>6. Logi Administratora</h3>\r\n  <ol>\r\n    <li>\r\n      Informacje zachowaniu użytkowników w serwisie mogą podlegać logowaniu. Dane te są wykorzystywane w celu administrowania serwisem.\r\n    </li>\r\n  </ol>\r\n\r\n  <h3>7. Istotne techniki marketingowe</h3>\r\n  <ol>\r\n    <li>\r\n      Operator stosuje analizę statystyczną ruchu na stronie, poprzez Google Analytics (Google Inc. z siedzibą w USA). Operator nie przekazuje do operatora tej usługi danych osobowych, a jedynie zanonimizowane informacje. Usługa bazuje na wykorzystaniu ciasteczek w urządzeniu końcowym użytkownika. W zakresie informacji o preferencjach użytkownika gromadzonych przez sieć reklamową Google użytkownik może przeglądać i edytować informacje wynikające z plików cookies przy pomocy narzędzia: https://www.google.com/ads/preferences/\r\n    </li>\r\n  </ol>\r\n\r\n  <h3>8. Informacja o plikach cookies</h3>\r\n  <ol>\r\n    <li>Serwis korzysta z plików cookies.</li>\r\n    <li>\r\n      Pliki cookies (tzw. „ciasteczka”) stanowią dane informatyczne, w szczególności pliki tekstowe, które przechowywane są w urządzeniu końcowym Użytkownika Serwisu i przeznaczone są do korzystania ze stron internetowych Serwisu. Cookies zazwyczaj zawierają nazwę strony internetowej, z której pochodzą, czas przechowywania ich na urządzeniu końcowym oraz unikalny numer.\r\n    </li>\r\n    <li>\r\n      Podmiotem zamieszczającym na urządzeniu końcowym Użytkownika Serwisu pliki cookies oraz uzyskującym do nich dostęp jest operator Serwisu.\r\n    </li>\r\n    <li>\r\n      Pliki cookies wykorzystywane są w następujących celach:\r\n      <ul>\r\n        <li>\r\n          utrzymanie sesji użytkownika Serwisu (po zalogowaniu), dzięki której użytkownik nie musi na każdej podstronie Serwisu ponownie wpisywać loginu i hasła;\r\n        </li>\r\n        <li>\r\n          realizacji celów określonych powyżej w części \"Istotne techniki marketingowe\";\r\n        </li>\r\n      </ul>\r\n    </li>\r\n    <li>\r\n      W ramach Serwisu stosowane są dwa zasadnicze rodzaje plików cookies: „sesyjne” (session cookies) oraz „stałe” (persistent cookies). Cookies „sesyjne” są plikami tymczasowymi, które przechowywane są w urządzeniu końcowym Użytkownika do czasu wylogowania, opuszczenia strony internetowej lub wyłączenia oprogramowania (przeglądarki internetowej). „Stałe” pliki cookies przechowywane są w urządzeniu końcowym Użytkownika przez czas określony w parametrach plików cookies lub do czasu ich usunięcia przez Użytkownika.\r\n    </li>\r\n    <li>\r\n      Oprogramowanie do przeglądania stron internetowych (przeglądarka internetowa) zazwyczaj domyślnie dopuszcza przechowywanie plików cookies w urządzeniu końcowym Użytkownika. Użytkownicy Serwisu mogą dokonać zmiany ustawień w tym zakresie. Przeglądarka internetowa umożliwia usunięcie plików cookies. Możliwe jest także automatyczne blokowanie plików cookies Szczegółowe informacje na ten temat zawiera pomoc lub dokumentacja przeglądarki internetowej.\r\n    </li>\r\n    <li>\r\n      Ograniczenia stosowania plików cookies mogą wpłynąć na niektóre funkcjonalności dostępne na stronach internetowych Serwisu.\r\n    </li>\r\n    <li>\r\n      Pliki cookies zamieszczane w urządzeniu końcowym Użytkownika Serwisu wykorzystywane mogą być również przez współpracujące z operatorem Serwisu podmioty, w szczególności dotyczy to firm: Google (Google Inc. z siedzibą w USA), Facebook (Facebook Inc. z siedzibą w USA), Twitter (Twitter Inc. z siedzibą w USA).\r\n    </li>\r\n  </ol>\r\n\r\n  <h3>9. Zarządzanie plikami cookies – jak w praktyce wyrażać i cofać zgodę?</h3>\r\n  <ol>\r\n    <li>\r\n      Jeśli użytkownik nie chce otrzymywać plików cookies, może zmienić ustawienia przeglądarki. Zastrzegamy, że wyłączenie obsługi plików cookies niezbędnych dla procesów uwierzytelniania, bezpieczeństwa, utrzymania preferencji użytkownika może utrudnić, a w skrajnych przypadkach może uniemożliwić korzystanie ze stron www\r\n    </li>\r\n    <li>\r\n      W celu zarządzania ustawienia cookies wybierz z listy poniżej przeglądarkę internetową, której używasz i postępuj zgodnie z instrukcjami:\r\n      <ul>\r\n        <li>Edge</li>\r\n        <li>Internet Explorer</li>\r\n        <li>Chrome</li>\r\n        <li>Safari</li>\r\n        <li>Firefox</li>\r\n        <li>Opera</li>\r\n      </ul>\r\n      Urządzenia mobilne:\r\n      <ul>\r\n        <li>Android</li>\r\n        <li>Safari (iOS)</li>\r\n        <li>Windows Phone</li>\r\n      </ul>\r\n    </li>\r\n  </ol>\r\n</ion-content>\r\n");

